import React from'react'

import ReactOne from './../src/Assests/Images/ReactOne.png'

function Home() 
{
    return(
         <div>
        <span ClassName="text-center p-5"><h1>CATEGORIES</h1></span>

  
<div ClassName="row">
    {/*coloum*/}
     <div ClassName="col-lg-4 col-md-4 col-sm-6 col-12"> 
        <a href="T-Shirts.html" ClassName="pagelink"><img ClassName="card-img-top w-35 mx-auto my-3" src="https://prod-img.thesouledstore.com/public/theSoul/storage/mobile-cms-media-prod/product-images/tshirt_web.jpg?format=webp&w=480&dpr=1.3"/></a>
       </div>
{/*coloum*/}

{/*coloum*/}
<div ClassName="col-lg-4 col-md-4 col-sm-6 col-12"> 
  <a href="Dresses.html" ClassName="pagelink"><img ClassName="card-img-top w-35 mx-auto my-3" src="https://prod-img.thesouledstore.com/public/theSoul/storage/mobile-cms-media-prod/product-images/dressname-tiles_tl64iMG.jpg?format=webp&w=480&dpr=1.3"/></a>
 </div>
{/*coloum*/}

{/*coloum*/}
<div ClassName="col-lg-4 col-md-4 col-sm-6 col-12"> 
  <a href="Shirts.html" ClassName="pagelink"><img ClassName="card-img-top w-35 mx-auto my-3" src="https://prod-img.thesouledstore.com/public/theSoul/storage/mobile-cms-media-prod/product-images/shirt-web1.jpg?format=webp&w=480&dpr=1.3"/></a>
 </div>
{/*coloum*/}
</div>

<div ClassName="row">
  {/*coloum*/}
  <div ClassName="col-lg-3 col-md-4 col-sm-6 col-12"> 
     <a href="T-Shirts.html" ClassName="pagelink"><img ClassName="card-img-top w-35 mx-auto my-3" src="https://prod-img.thesouledstore.com/public/theSoul/storage/mobile-cms-media-prod/product-images/dropcut_web.jpg?format=webp&w=360&dpr=1.3"/></a>
    </div>
 {/*coloum*/}

{/*coloum*/}
<div ClassName="col-lg-3 col-md-4 col-sm-6 col-12"> 
<a href="Woven Jogger Pants.html" ClassName="pagelink"><img ClassName="card-img-top w-35 mx-auto my-3" src="https://prod-img.thesouledstore.com/public/theSoul/storage/mobile-cms-media-prod/product-images/woven_jogger_pants_web.jpg?format=webp&w=360&dpr=1.3"/></a>
</div>
{/*coloum*/}

{/*coloum*/}
<div ClassName="col-lg-6 col-md-4 col-sm-6 col-12"> 
<a href="Men's Pajamas.html" ClassName="pagelink"><img ClassName="card-img-top w-35 mx-auto my-3" src="https://prod-img.thesouledstore.com/public/theSoul/storage/mobile-cms-media-prod/product-images/pajamasweb.jpg?format=webp&w=750&dpr=1.3"/></a>
</div>
{/*coloum*/}
</div>


<div ClassName="row">
  {/*coloum*/}
  <div ClassName="col-lg-6 col-md-4 col-sm-6 col-12"> 
     <a href="Men's Cotton Pants.html" ClassName="pagelink"><img ClassName="card-img-top w-35 mx-auto my-3" src="https://prod-img.thesouledstore.com/public/theSoul/storage/mobile-cms-media-prod/product-images/men_cotton_pants_web.jpg?format=webp&w=750&dpr=1.3"/></a>
    </div>
{/*coloum*/}

{/*coloum*/}
<div ClassName="col-lg-3 col-md-4 col-sm-6 col-12"> 
<a href="Shorts.html" ClassName="pagelink"><img ClassName="card-img-top w-35 mx-auto my-3" src="https://prod-img.thesouledstore.com/public/theSoul/storage/mobile-cms-media-prod/product-images/shorts_web.jpg?format=webp&w=360&dpr=1.3"/></a>
</div>
{/*coloum*/}

{/*coloum*/}
<div ClassName="col-lg-3 col-md-4 col-sm-6 col-12"> 
<a href="Polos.html" ClassName="pagelink"><img ClassName="card-img-top w-35 mx-auto my-3" src="https://prod-img.thesouledstore.com/public/theSoul/storage/mobile-cms-media-prod/product-images/polo_web.jpg?format=webp&w=360&dpr=1.3"/></a>
</div>
{/*coloum*/}
</div>

<div ClassName="row">
{/*coloum*/}
  <div ClassName="col-lg-3 col-md-4 col-sm-6 col-12"> 
     <a href="Men's Joggers.html" ClassName="pagelink"><img ClassName="card-img-top w-35 mx-auto my-3" src="https://prod-img.thesouledstore.com/public/theSoul/storage/mobile-cms-media-prod/product-images/men_jogger_web_6xxqlvE.jpg?format=webp&w=360&dpr=1.3"/></a>
    </div>
{/*coloum*/}

{/*coloum*/}
<div ClassName="col-lg-3 col-md-4 col-sm-6 col-12"> 
<a href="Women's Shirts.html" ClassName="pagelink"><img ClassName="card-img-top w-35 mx-auto my-3" src="https://prod-img.thesouledstore.com/public/theSoul/storage/mobile-cms-media-prod/product-images/women_shirt_web.jpg?format=webp&w=360&dpr=1.3"/></a>
</div>
{/*coloum*/}

{/*coloum*/}
<div ClassName="col-lg-6 col-md-4 col-sm-6 col-12"> 
<a href="Boxers.html" ClassName="pagelink"><img ClassName="card-img-top w-35 mx-auto my-3"  src="https://prod-img.thesouledstore.com/public/theSoul/storage/mobile-cms-media-prod/product-images/boxer_web_ZbgVXj4.jpg?format=webp&w=750&dpr=1.3"/></a>
</div>
{/*coloum*/}
</div>


<div ClassName="row">
 
{/*coloum*/}
<div ClassName="col-lg-3 col-md-4 col-sm-6 col-12"> 
  <a href="Full Sleev T-shirts.html" ClassName="pagelink"><img ClassName="card-img-top w-35 mx-auto my-3" src="https://prod-img.thesouledstore.com/public/theSoul/storage/mobile-cms-media-prod/product-images/full_sleeve_web.jpg?format=webp&w=360&dpr=1.3"/></a>
 </div>
{/*coloum*/}

{/*coloum*/}
<div ClassName="col-lg-3 col-md-4 col-sm-6 col-12"> 
<a href="Tank Tops.html" ClassName="pagelink"><img ClassName="card-img-top w-35 mx-auto my-3" src="https://prod-img.thesouledstore.com/public/theSoul/storage/mobile-cms-media-prod/product-images/woman_tank_top_web.jpg?format=webp&w=360&dpr=1.3"/></a>
</div>
{/*coloum*/}

